import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">


          <Route path="/"/>
          <Route path="/about" />
          <Route path="/contact" />


      </div>
    </Router>
  );
}

export default App;
